FeedPackage.Summary:
This library has no dependencies to minimize complexity.
Just do:
var client = new DotNetSlackClient.SlackClient("http://mywebhookurl");
client.NotifySlack("hi there");

FeedPackage.Description:
library that allows embeding gecko in C# applications.

	Example Usage:

		[STAThread]
        static void Main(string[] args)
        {
            Xpcom.Initialize("Firefox");
            var geckoWebBrowser = new GeckoWebBrowser {Dock = DockStyle.Fill};
            Form f = new Form();
            f.Controls.Add(geckoWebBrowser);
            geckoWebBrowser.Navigate("www.google.com");
            Application.Run(f);
        }

